Watching the 999 vods started to get annoying trying to figure out ||the digital roots and who can go into what door|| so I wrote some python code to give the valid combinations
||```from itertools import combinations

def get_root(comb):
    temp = comb
    while True:
        root = sum(temp)
        if root < 10:
            return root
        temp = [int(a) for a in str(root)]

def check_for_root(nums, key, lengths):
    valid_combs = []
    for length in lengths:
        for comb in combinations(nums, length):
            if get_root(comb) == key:
                print(f"Found root {key} with {comb}")
                valid_combs.append(comb)
    return valid_combs

def door_combinations(comb1, comb2):
    temp = []
    for i in comb1:
        for j in comb2:
            if not set(i) & set(j):
                print(f"Found valid door groups with {i} and {j}")
                temp.append([i,j])
    return temp

nums = [1, 3, 4, 5, 6, 7, 8]
valid_lengths = [3,4,5]
key1 = 7
key2 = 8

comb1 = check_for_root(nums=nums,key=key1,lengths=valid_lengths)
comb2 = check_for_root(nums=nums,key=key2,lengths=valid_lengths)

print(door_combinations(comb1=comb1,comb2=comb2))```||
